column4:
LOCAÇÃO DE 01 IMPRESSORA COLORIDA A LASER A4 - impressora colorida a laser A4: tecnologia laser A4; velocidade mínima de 30 ppm; bandeja de alimentação de papel para 500 folhas, processador mínimo de 500 mhz; resolução mínima de impressão: 600X600; volume de impressão de no mínimo 50.000 páginas mês; memória mínima de 64mb; tensão de entrada: 220V (fornecedor transformador ou estabilizador adequado se precise); conectividade USB 2, 10/100 base TX Ethernet; linguagem de descrição de página: postscript 3, PCL 5; deverá ser acompanhada de cabo de força e cabo USB; drivers compatíveis com windows XP, windows 7; todos os materiais e instruções dos equipamentos, inclusive no painel, devem possuir as informações em português;
REQUISITOS OBRIGATÓRIOS: todas as impressoras deverão ser novas, de primeiro uso, em linha de fabricação, de um mesmo fabricante; a proponente deverá fornecer catálogo do fabricante contendo as especificações da máquina para cada um dos modelos ofertados, visando conferência das especificações do edital, caso solicitado no certame; declaração do fabricante ou distribuidor oficial no Brasil, dizendo que a licitante é assistência técnica autorizada local e revenda autorizada local; declaração do fabricante ou distribuidor oficial no Brasil, dizendo que a licitante possui, no mínimo, 02 técnicos capacitados para a manutenção dos equipamentos;
SUPORTE: o atendimento será em horário comercial, de segunda a sexta-feira, on-site, na cidade de João Pessoa; os chamados técnicos serão abertos por e-mail ou por telefone; a abertura de chamado técnico deverá ser confirmada pela contratada por e-mail num prazo de 10 min. Após abertura; o prazo máximo para que se inicie o atendimento técnico será de 04 (quatro) horas comerciais, contando a partir do momento em que for realizado o chamado técnico devidamente formalizado; o tempo máximo de paralisação tolerável do objeto será de 24 (vinte e quatro) horas, a partir da abertura do chamado. Caso a contratada não termine o reparo do objeto no prazo estabelecido e a critério da contratante, a utilização do objeto torna-se inviável, a contratada deverá substituí-lo no prazo de 4 (quatro) horas por outro, com características e capacidades iguais ou superiores ao substituído. A contratada disponibilizará com cada impressora, um toner de reserva: os insumos vazios serão repostos on-site pela contratada após abertura de chamado num prazo máximo de 72 horas.
FRANQUIA MENSAL: franquia mensal: 1500 páginas por mês por impressora; as franquias deste projeto serão franquias globais para a quantidade de equipamentos contratados respectivamente. Isso se dá pela multiplicação da franquia de cada máquina, pela quantidade de máquinas contratadas no processo de locação. À medida que mais equipamentos forem acrescentados ao contrato de locação, a franquia proporcionalmente aumentará.
